# 坍낹某
proxy-groups:
  - name: 游 국좰괝길
    type: select
    proxies:
      - 鮫勇 쀤궏괝길
      - 游뚬 賴剖럳쫇椧
      - 丘뒲잺 榜蚌쫸롆發-蚌쉳식
      - 丘뒲잺 榜蚌쫸롆發-賴갱
      - DIRECT
    include-all: true

  - name: 鮫勇 쀤궏괝길
    type: url-test
    lazy: false
    interval: 300
    timeout: 5000
    tolerance: 100
    url: https://www.google.com/gen_204
    include-all: true

  - name: 游뚬 賴剖럳쫇椧
    type: fallback
    lazy: false
    interval: 300
    timeout: 5000
    tolerance: 100
    url: https://www.google.com/gen_204
    include-all: true

  - name: 丘뒲잺 榜蚌쫸롆發-蚌쉳식
    type: load-balance
    strategy: round-robin
    lazy: false
    interval: 300
    timeout: 5000
    tolerance: 100
    url: https://www.google.com/gen_204
    include-all: true

  - name: 丘뒲잺 榜蚌쫸롆發-賴갱
    type: load-balance
    strategy: consistent-hashing
    lazy: false
    interval: 300
    timeout: 5000
    tolerance: 100
    url: https://www.google.com/gen_204
    include-all: true

  - name: 游깴 騰쫸뱄落뉛쪱
    type: select
    proxies: ['游 국좰괝길', '鮫勇 쀤궏괝길', '游뚬 賴剖럳쫇椧', '丘뒲잺 榜蚌쫸롆發-蚌쉳식', '丘뒲잺 榜蚌쫸롆發-賴갱', '游꿢 뻖낶眠얻']

  - name: 游 覓왡권淡뫥
